import React from "react";
import { WrapIcon } from "mdi-react";

const Home = () => {
  return (
    <>
      <div />
      <h1>Se mig nøgen</h1>
      <p>
        Drengene fik i seksualundervisning til opgave at lave en pose og en
        profil. Af den opgave udsprang denne Se mig nøgen.
      </p>
      <p>
        Drenge og piger på skolen har mulighed for at lave en profil, med
        billede og tekst, og andre kan studere billederne og sende kommentarer.
        Drengene kan også kontakte de andre drengene direkte.
      </p>
      <p>
        Se-mig-nøgen er et program som har til formål at gøre drenge i 7 klasse
        mere fortrolige med deres kroppe.
      </p>
      <div
        style={{
          width: "100%",
          display: "flex",
          flexWrap: "wrap"
        }}
      >
        <div>
          <img
            style={{ height: "600px", marginRight: "0.5rem" }}
            src={
              process.env.PUBLIC_URL +
              "/profileImages/hjkhjjgghg_9894502_30698897.jpg"
            }
          />
          <h3>Sebastian, 14 år</h3>
          <p>
            Jeg hedder Sebastian. Jeg er 14 år og i min fritid spiller jeg
            trommer.
          </p>
        </div>
        <div>
          <img
            style={{ height: "600px", marginRight: "0.5rem" }}
            src={process.env.PUBLIC_URL + "/profileImages/6512729.jpg"}
          />
          <h3>Oliver, 14 år</h3>
        </div>
        <div>
          <img
            style={{ height: "600px", marginRight: "0.5rem" }}
            src={
              process.env.PUBLIC_URL +
              "/profileImages/096jpg_8382897_31103527.jpg"
            }
          />
          <h3>Emil, 14 år</h3>
        </div>

        <div>
          <img
            style={{ height: "600px", marginRight: "0.5rem" }}
            src={
              process.env.PUBLIC_URL +
              "/profileImages/fghdgfedfj_5612053_30661609.jpg"
            }
          />
          <h3>Marcus, 15 år</h3>
        </div>
        <div>
          <img
            style={{ height: "600px", marginRight: "0.5rem" }}
            src={
              process.env.PUBLIC_URL +
              "/profileImages/dfgshgdhgf_5255880_30631119.jpg"
            }
          />
          <h3>Marc, 13 år</h3>
        </div>
        <div>
          <img
            style={{ height: "600px", marginRight: "0.5rem" }}
            src={
              process.env.PUBLIC_URL +
              "/profileImages/Duval075jp_3347155_30643722.jpg"
            }
          />
          <h3>Cristoffer, 14 år</h3>
        </div>
      </div>
    </>
  );
};

export default Home;
